import React from 'react';
import styles from '../madebyustyles.module.css';

const RegisteredSuccessfuly = () => { // Updated component name
  return (
    <div className={styles.regwrp}>
        <h1 className={styles.successfulreg}>თქვენ დარეგისტრირდით წარმატებით!</h1>
    </div>
  )
}

export default RegisteredSuccessfuly;
